pragma solidity 0.8.4;

import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./Voting.sol";
import "./RealmLands.sol";

contract Realm is ERC1155, Voting, OwnableUpgradeable {

    enum ProposalTypes{ADD, REMOVE}

    event ProposalSubmitted(
        uint256 proposalId,
        address nftAddress,
        uint256 nftId,
        address owner,
        string proposalType
    );

    event ProposalAccepted(
        uint256 proposalId,
        address nftAddress,
        uint256 nftId,
        uint256 extensionId
    );

    event Voted(
        uint256 proposalId,
        address voter
    );

    uint256 public taxRate;
    uint256 public protocolFee;

    uint256 private _tokenId;
    uint256 public votingTime;
    uint256 private _creatorShare;
    uint256 public depositFee;


    /// @dev proposal id => proposal type
    mapping (uint256 => ProposalTypes) private _proposalTypes;

    /// @dev extension ID => add proposal ID
    mapping (uint256 => uint256) private _extensionToAddProposal;

    /// @dev remove extension proposal ID => extension ID
    mapping (uint256 => uint256) private _proposalToExtension;

    /// @dev extension ID => realmLands address
    mapping (uint256 => address) private _extensionRealmLands;

    mapping (address => mapping(uint256 => uint256)) private _deposits;

    uint256 private _taxes;

    uint256 private _protocolFees;

    constructor() ERC1155("") {}

    function initialize(
        string memory uri,
        address caller,
        uint256 taxRate_,
        uint256 creatorShare,
        address nftToAttachAddress,
        uint256 nftToAttachId
    ) external initializer onlyOwner {
        __Ownable_init();

        _setURI(uri);
        _setTaxRate(taxRate_);
        _setCreatorShare(creatorShare);
        _attachNFT(nftToAttachAddress, nftToAttachId, caller);
        _setCreatorShare(caller, creatorShare);
        _addVotingPower(caller);
    }

    /**
     * @notice Submit proposal to add an extension
     * @param nftToAttachAddress address of the NFT to attach
     * @param nftToAttachId ID of the NFT to attach
     */
    function addExtension(
        address nftToAttachAddress,
        uint256 nftToAttachId
    ) public payable {
        // Make sure that caller is owner of ERC721
        address tokenOwner = IERC721Metadata(nftToAttachAddress).ownerOf(nftToAttachId);
        address approvedFor = IERC721Metadata(nftToAttachAddress).getApproved(nftToAttachId);

        require(tokenOwner == msg.sender, "You are not the owner!");
        require(approvedFor == address(this), "Realm should be approved!");

        // Queue proposal for voting
        uint256 proposalId = _queueForVoting(
            nftToAttachAddress,
            nftToAttachId,
            msg.sender,
            votingTime
        );

        // save proposal type
        _proposalTypes[proposalId] = ProposalTypes.ADD;

        if (depositFee > 0) {
            require(msg.value == depositFee, "msg.value should equal depositFee!");

            uint256 depositFeeValue = msg.value;

            if (taxRate > 0) {
                uint256 tax = msg.value * taxRate / 10000;
                depositFeeValue -= tax;
                _taxes += tax;
            }

            if (protocolFee > 0) {
                uint256 protocolFeeValue = msg.value * _protocolFees / 10000;
                depositFeeValue -= protocolFeeValue;
                _protocolFees += protocolFeeValue;
            }

            _deposits[msg.sender][proposalId] += depositFeeValue;

        }

        emit ProposalSubmitted(
            proposalId,
            nftToAttachAddress,
            nftToAttachId,
            msg.sender,
            "ADD"
        );
    }

    /// @notice Submit proposal to remove an extension
    function removeExtension(
        uint256 extensionTokenId
    ) public {
        uint256 tokenBalance = balanceOf(msg.sender, extensionTokenId);
        require(tokenBalance > 0, "You are not the owner of the extension");

        // Get add proposal ID to get token data
        uint256 addProposalId = _extensionToAddProposal[extensionTokenId];
        // Get token data
        (address tokenAddress, uint256 tokenId, address owner) = _getTokenData(addProposalId);

        // Queue for voting
        uint256 proposalId = _queueForVoting(
            tokenAddress,
            tokenId,
            owner,
            votingTime
        );

        // Save data in mappings
        _proposalTypes[proposalId] = ProposalTypes.REMOVE;
        _proposalToExtension[proposalId] = extensionTokenId;

        emit ProposalSubmitted(
            proposalId,
            tokenAddress,
            tokenId,
            msg.sender,
            "REMOVE"
        );
    }

    function voteForProposal(uint256 proposalId) external {
        bool votingApproved = _voteForProposal(proposalId);

        if (votingApproved) {
            if (_proposalTypes[proposalId] == ProposalTypes.ADD) {

                (address tokenAddress, uint256 tokenId, address proposer) = _getTokenData(proposalId);

                uint256 newTokenId = _attachNFT(tokenAddress, tokenId, proposer);

                _extensionToAddProposal[newTokenId] = proposalId;

                _addVotingPower(proposer);

                emit ProposalAccepted(
                    proposalId,
                    tokenAddress,
                    tokenId,
                    newTokenId
                );
            }

            if (_proposalTypes[proposalId] == ProposalTypes.REMOVE) {
                uint256 extensionId = _proposalToExtension[proposalId];

                uint256 addProposalId = _extensionToAddProposal[extensionId];

                (address tokenAddress, uint256 tokenId, address owner) = _getTokenData(addProposalId);

                _unattachNFT(tokenAddress, tokenId, owner, extensionId);

                _removeVotingPower(owner);

                emit ProposalAccepted(
                    proposalId,
                    tokenAddress,
                    tokenId,
                    extensionId
                );
            }
        }

        emit Voted(proposalId, msg.sender);
    }

    function setVotingTime(uint256 votingTime_) external onlyOwner {
        votingTime = votingTime_;
    }
   
    function _createRealmLands(uint256 extensionId ) internal {
        address realmLands = address(new RealmLands());
        _extensionRealmLands[extensionId] = realmLands;
    }

    function _attachNFT(
        address collection,
        uint256 tokenId,
        address from
    ) internal returns(uint256) {

        IERC721Metadata(collection).transferFrom(
            from,
            address(this),
            tokenId
        );

        _tokenId += 1;

        _mint(from, _tokenId, 1, "");

        return _tokenId;
    }

    function _unattachNFT(
        address collection,
        uint256 tokenId,
        address to,
        uint256 extensionId
    ) internal {
        IERC721Metadata(collection).transferFrom(
            address(this),
            to,
            tokenId
        );

        _burn(to, extensionId, 1);

    }

    function setTaxRate(uint256 taxRate_) external onlyOwner {
        _setTaxRate(taxRate_);
    }

    function _setTaxRate(uint256 taxRate_) internal {
        require(taxRate_ >= 0, "taxRate must be >= than 0");
        require(taxRate_ < 10000, "taxRate must be < than 10000");
        taxRate = taxRate_;
    }

    function _setCreatorShare(uint256 creatorShare_) internal {
        require(creatorShare_ >= 0, "creatorShare_ must be >= than 0");
        require(creatorShare_ < 10000, "creatorShare_ must be < than 10000");
        _creatorShare = creatorShare_;
    }

    function getRealmLandsAddress(uint256 extensionId) public view returns (address) {
        return _extensionRealmLands[extensionId];
    }

    function _msgSender() internal view override (Context, ContextUpgradeable) returns (address) {
        return msg.sender;
    }

    function _msgData() internal view override (Context, ContextUpgradeable) returns (bytes calldata) {
        return msg.data;
    }

    function setDepositFee(uint256 depositFee_) public onlyOwner {
        depositFee = depositFee_;
    }

    function setProtocolFee(uint256 protocolFee_) public onlyOwner {
        protocolFee = protocolFee_;
    }

    function withdrawDepositFee(uint256 proposalId) public {
        uint256 votingEnd = getProposalVotingEnd(proposalId);
        address votingOwner = getProposalOwner(proposalId);
        require(votingOwner == msg.sender, "You are not the owner of the proposal!");
        require(votingEnd <= block.timestamp, "Voting is not finished!");

        uint256 depositValue = _deposits[msg.sender][proposalId];
        payable(msg.sender).transfer(depositValue);
    }

}","keccak256":"0x47fd5b0effaab55e6c3409c7da56504cf036ec80ff104f2173f4d41edbc39384","license":"MIT"},"contracts/RealmLands.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity 0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract RealmLands is ERC721, Ownable {
    constructor() ERC721("", "") {} 

    function mint(address to, uint256 tokenId) public onlyOwner {
        _safeMint(to, tokenId);
    }
}
","keccak256":"0xf051919d80e6e7a67ed1ac6a13acc0be00972dc73e61e9cbf92011ac6148bc1e","license":"MIT"},"contracts/Voting.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity 0.8.4;

abstract contract Voting  {

    uint256 private _votingProposalCounter;

    uint256 public votingPower;

    address private _creatorAddress;
    uint256 private _creatorShare;

    mapping (address => uint256) public votingPowerByAddress;

    struct Proposal {
        address tokenAddress;
        uint256 tokenId;
        address owner;
        uint256 votes;
        uint256 votingEnd;
    }

    mapping(uint256 => Proposal) public proposals;
    mapping(address => mapping(uint256 => bool)) hasVotedForProposal;

    constructor() {}

    function _addVotingPower(address owner) internal {
        votingPower += 10000;

        uint256 votingPowerCreator = 10000 * _creatorShare / 10000;
        uint256 votingPowerOwner = 10000 - votingPowerCreator;

        votingPowerByAddress[_creatorAddress] += votingPowerCreator;
        votingPowerByAddress[owner] += votingPowerOwner;

    }

    function _removeVotingPower(address owner) internal {
        votingPower -= 10000;
        uint256 votingPowerCreator = 10000 * _creatorShare / 10000;
        uint256 votingPowerOwner = 10000 - votingPowerCreator;

        votingPowerByAddress[_creatorAddress] += votingPowerCreator;
        votingPowerByAddress[owner] += votingPowerOwner;
    }

    function _queueForVoting(
        address nftToAttachAddress,
        uint256 nftToAttachId,
        address caller,
        uint256 votingTime_
    ) internal returns (uint256) {
        proposals[_votingProposalCounter] = Proposal(
            nftToAttachAddress,
            nftToAttachId,
            caller,
            0,
            block.timestamp + votingTime_
        );

        _votingProposalCounter += 1;

        return _votingProposalCounter;
    }

    function _voteForProposal(uint256 proposalId) internal returns (bool) {
        require(
            proposals[proposalId].tokenAddress != address(0), 
            "Non existent proposal"
        );
        require(
            hasVotedForProposal[msg.sender][proposalId] == false,
            "Can't vote for same proposal twice!"
        );

        require(
            proposals[proposalId].votingEnd > block.timestamp,
            "Proposal has expired"
        );

        require(
            votingPowerByAddress[msg.sender] > 0,
            "You do not have voting power"
        );

        proposals[proposalId].votes += votingPowerByAddress[msg.sender];

        hasVotedForProposal[msg.sender][proposalId] = true;

        if (proposals[proposalId].votes > votingPower / 2) {
            return true;
        } else {
            return false;
        }
    }

    function _getTokenData(uint256 proposalId) internal view returns (address tokenAddress, uint256 tokenId, address owner) {
        tokenAddress = proposals[proposalId].tokenAddress;
        tokenId = proposals[proposalId].tokenId;
        owner = proposals[proposalId].owner;
    }

    function _setCreatorShare(
        address creatorAddress, 
        uint256 creatorShare
    ) internal {
        require(creatorAddress != address(0));
        require(creatorShare > 0);
        _creatorAddress = creatorAddress;
        _creatorShare = creatorShare;
    }

    function getProposalVotingEnd(uint256 proposalId) public view returns (uint256) {
        return proposals[proposalId].votingEnd;
    }

    function getProposalTokenAddress(uint256 proposalId) public view returns (address) {
        return proposals[proposalId].tokenAddress;
    }

    function getProposalTokenId(uint256 proposalId) public view returns (uint256) {
        return proposals[proposalId].tokenId;
    }

    function getProposalOwner(uint256 proposalId) public view returns (address) {
        return proposals[proposalId].owner;
    }

    function getProposalVotes(uint256 proposalId) public view returns (uint256) {
        return proposals[proposalId].votes;
    }
}","keccak256":"0x1f796fd0ec21927beba6f31fdfb9436a59ef6ee172742e0b69018d6233eb92e1","license":"MIT"}},"version":1}
